import{_ as t,o as d,c as e,a as r}from"./app-1abbb6ea.js";const o={},a=r('<h1 id="网络相关知识" tabindex="-1"><a class="header-anchor" href="#网络相关知识" aria-hidden="true">#</a> 网络相关知识</h1><h2 id="_1-常见状态码" tabindex="-1"><a class="header-anchor" href="#_1-常见状态码" aria-hidden="true">#</a> 1. 常见状态码?</h2><table><thead><tr><th></th><th>类别</th><th>原因短语</th></tr></thead><tbody><tr><td>1XX</td><td>Informational（信息性状态码）</td><td>接受的请求正在处理</td></tr><tr><td>2XX</td><td>Success（成功状态码）</td><td>请求正常处理完毕</td></tr><tr><td>3XX</td><td>Redirection（重定向状态码）</td><td>需要进行附加操作以完成请求</td></tr><tr><td>4XX</td><td>Client Error（客户端错误状态码）</td><td>服务器无法处理请求</td></tr><tr><td>5XX</td><td>Server Error（服务器错误状态码）</td><td>服务器处理请求出错</td></tr></tbody></table><p>常见 HTTP 状态码</p><table><thead><tr><th>状态码</th><th>状态码英文名称</th><th>中文描述</th></tr></thead><tbody><tr><td>200</td><td>OK</td><td><code>请求成功</code>, 一般用于 GET 与 POST 请求</td></tr><tr><td>204</td><td>No Content</td><td>无内容。<code>服务器成功处理，但未返回内容</code>。在未更新网页的情况下，可确保浏览器继续显示当前文档</td></tr><tr><td>206</td><td>Partial Content</td><td><code>是对资源某一部分的请求</code>，服务器成功处理了部分 GET 请求，响应报文中包含由 Content-Range 指定范围的实体内容。</td></tr><tr><td>301</td><td>Moved Permanently</td><td><code>永久性重定向</code>。请求的资源已被永久的移动到 新URL，返回信息会包括新的URL，浏览器会自动定向到 新URL。今后任何新的请求都应使用新的URL代替</td></tr><tr><td>302</td><td>Found</td><td><code>临时性重定向</code>。与301类似。但资源只是临时被移动。客户端应继续使用原有URL</td></tr><tr><td>303</td><td>See Other</td><td><code>查看其它地址</code>。与302类似。使用GET请求查看</td></tr><tr><td>304</td><td>Not Modified</td><td>未修改。所请求的资源未修改，服务器返回此状态码时，不会返回任何资源。客户端通常会缓存访问过的资源，通过提供一个头信息指出客户端希望只返回在指定日期之后修改的资源</td></tr><tr><td>307</td><td>Temporary Redirect</td><td><code>临时重定向</code>。与302类似。使用GET请求重定向，会按照浏览器标准，不会从POST变成GET。</td></tr><tr><td>400</td><td>Bad Request</td><td><code>客户端请求报文中存在语法错误，服务器无法理解</code>。浏览器会像200 OK一样对待该状态吗</td></tr><tr><td>401</td><td>Unauthorized</td><td><code>请求要求用户的身份认证</code>，通过HTTP认证（BASIC认证，DIGEST认证）的认证信息，若之前已进行过一次请求，则表示用户认证失败</td></tr><tr><td>403</td><td>Forbidden</td><td><code>服务器理解请求客户端的请求，但是拒绝执行此请求</code></td></tr><tr><td>404</td><td>Not Found</td><td>服务器无法根据客户端的请求找到资源（网页）。通过此代码，网站设计人员可设置&quot;您所请求的资源无法找到&quot;的个性页面。也可以在服务器拒绝请求且不想说明理由时使用</td></tr><tr><td>500</td><td>Internal Server Error</td><td><code>服务器内部错误，无法完成请求</code>，也可能是web应用存在bug或某些临时故障</td></tr><tr><td>501</td><td>Not Implemented</td><td>服务器不支持请求的功能，无法完成请求</td></tr><tr><td>503</td><td>Service Unavailable</td><td><code>由于超载或系统维护，服务器暂时的无法处理客户端的请求</code>。延时的长度可包含在服务器的Retry-After头信息中</td></tr></tbody></table><h2 id="_2-前端怎么进行加密" tabindex="-1"><a class="header-anchor" href="#_2-前端怎么进行加密" aria-hidden="true">#</a> 2. 前端怎么进行加密?</h2><ul><li>MD5</li><li>base64</li><li>用一些插件</li></ul>',7),c=[a];function n(h,i){return d(),e("div",null,c)}const _=t(o,[["render",n],["__file","网络相关知识.html.vue"]]);export{_ as default};
